function App() {
  // Define an array of items
  const items = [
    { 
      titulo:"Politica 1",
      descripcion: "Esta es una descripcion de prueba de una comandate de la nasai",
      periodo: "Matutino",
      inicio: "13/03/20",
      final: "1/01/20",
      horas: "24",
      acumulativo:"no"
    },
    { 
