      acumulativo:"no"
    },
    { 
      titulo:"Politica 3",
      descripcion: "dias libres",
      periodo: "Matutino",
      inicio: "13/03/20",
      final: "1/01/20",
      horas: "24 h",
      acumulativo:"no"
    },
    { 
      titulo:"Politica 4",
      descripcion: "dias libres",
      periodo: "Matutino",
      inicio: "13/03/20",
      final: "1/01/20",
      horas: "24 h",
      acumulativo:"no"
    },
    { 
      titulo:"Politica 5",
      descripcion: "dias libres",
      periodo: "Matutino",
      inicio: "13/03/20",
      final: "1/01/20",
      horas: "24 h",
      acumulativo:"no"
    },
    // Add more items as needed
  ];

  return (
    <div>
      <h1>Politicas</h1>
        <MyComponent items={items} />
    </div>
  );
}

export default App;
